    [],nt"num_tags": 0,nt"name": "dissolved-inorganic-carbon-temperature-salinity-and-other-variables-collected-from-discrete-sam42333",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0113556 includes discrete
    sample and profile data collected from HUDSON in the Gulf of St. Lawrence and North
    Atlantic Ocean from 1995-04-19 to 1995-05-16 and retrieved during cruise CARINA/18HU19950419.
    These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113),
    CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride (CCL4), DISSOLVED INORGANIC
    CARBON (DIC), DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, Potential temperature
    (theta), SALINITY, WATER TEMPERATURE, methyl chloroform (MC), phosphate and silicate.
    The instruments used to collect these data include CTD and bottle.nnThese data were
    collected by E. Peter Jones of Bedford Institute of Oceanography, R. Gershey of
    Commonwealth Scientific and Industrial Research Organization and R.A. Clarke [affiliation
    unknown] as part of the CARINA/18HU19950419 data set.nnThe CARINA (CARbon dioxide
